  true,\n\t\"url\": null,\n\t\"notes\": \"The Global 15x15 Minute Grids of the Downscaled
  GDP Based on the Special Report on Emissions Scenarios (SRES) B2 Scenario, 1990
  and 2025, are geospatial distributions of Gross Domestic Product (GDP) per unit
  area (GDP densities). These global grids were generated using the Country-level
  GDP and Downscaled Projections Based on the SRES B2 Scenario, 1990-2100 dataset,
  and CIESIN's Gridded Population of World, Version 2 (GPWv2) dataset as the base
  map. First, the GDP per capita was developed at a country-level for 1990 and 2025.
  Then the gridded GDP was developed within each country by applying the GDP per capita
  to each grid cell of the GPW, under the assumption that the GDP per capita was uniform
  within a country. This dataset is produced and distributed by the Columbia University
  Center for International Earth Science Information Network (CIESIN).\",\n\t\"license_title\":
